import codecs
def xgcd(b, n):
    x0, x1, y0, y1 = 1, 0, 0, 1
    while n != 0:
        q, b, n = b // n, n, b % n
        x0, x1 = x1, x0 - q * x1
        y0, y1 = y1, y0 - q * y1
    return  b, x0, y0

N = int("",16)

e = 7
d = int("",16)
r = e * d - 1
Ae = int("7a69",16)
_, d, _ = xgcd(Ae,r)
d = d + r
Flag = int("",16)
flag_plain = pow(Flag,d,N)
flag_plain = hex(flag_plain)[2:]
print(codecs.decode(flag_plain,encoding="hex"))
